import React, { useState } from "react";

const PokemonMovesTable = ({
  pokemonData,
  currentSelectedPokemon,
  formatText,
}) => {
  const [currentPage, setCurrentPage] = useState(1);
  const movesPerPage = 5;

  const allMoves = pokemonData[currentSelectedPokemon].moves.sort((a, b) => {
    const levelA = a.version_group_details[0]?.level_learned_at || 999;
    const levelB = b.version_group_details[0]?.level_learned_at || 999;
    return levelA - levelB;
  });

  const indexOfLastMove = currentPage * movesPerPage;
  const indexOfFirstMove = indexOfLastMove - movesPerPage;
  const currentMoves = allMoves.slice(indexOfFirstMove, indexOfLastMove);

  const totalPages = Math.ceil(allMoves.length / movesPerPage);

  const handlePageChange = (newPage) => {
    setCurrentPage(newPage);
  };

  const handleNextPage = () => {
    if (currentPage < totalPages) {
      setCurrentPage(currentPage + 1);
    }
  };

  const handlePrevPage = () => {
    if (currentPage > 1) {
      setCurrentPage(currentPage - 1);
    }
  };

  const renderPagination = () => {
    const buttons = [];
    const maxButtons = 5;

    if (totalPages <= maxButtons) {
      // If there are 5 or fewer pages, display all page buttons
      for (let i = 1; i <= totalPages; i++) {
        buttons.push(
          <button
            key={i}
            onClick={() => handlePageChange(i)}
            className={`mx-2 ${
              currentPage === i ? "bg-blue-500 text-white" : "bg-gray-300"
            } px-4 py-2 rounded`}
          >
            {i}
          </button>
        );
      }
    } else {
      // If there are more than 5 pages, display first, last, and ellipsis buttons
      const firstPageButton = (
        <button
          key={1}
          onClick={() => handlePageChange(1)}
          className={`mx-2 ${
            currentPage === 1 ? "bg-blue-500 text-white" : "bg-gray-300"
          } px-4 py-2 rounded`}
        >
          1
        </button>
      );
      const lastPageButton = (
        <button
          key={totalPages}
          onClick={() => handlePageChange(totalPages)}
          className={`mx-2 ${
            currentPage === totalPages
              ? "bg-blue-500 text-white"
              : "bg-gray-300"
          } px-4 py-2 rounded`}
        >
          {totalPages}
        </button>
      );

      buttons.push(firstPageButton);

      // Calculate the range of buttons to display around the current page
      const start = Math.max(2, currentPage - 2);
      const end = Math.min(totalPages - 1, currentPage + 2);

      if (start > 2) {
        buttons.push(
          <button
            key={"ellipsis-start"}
            className="mx-2 bg-gray-300 px-4 py-2 rounded"
            disabled={true}
          >
            ...
          </button>
        );
      }

      for (let i = start; i <= end; i++) {
        buttons.push(
          <button
            key={i}
            onClick={() => handlePageChange(i)}
            className={`mx-2 ${
              currentPage === i ? "bg-blue-500 text-white" : "bg-gray-300"
            } px-4 py-2 rounded`}
          >
            {i}
          </button>
        );
      }

      if (end < totalPages - 1) {
        buttons.push(
          <button
            key={"ellipsis-end"}
            className="mx-2 bg-gray-300 px-4 py-2 rounded"
            disabled={true}
          >
            ...
          </button>
        );
      }

      buttons.push(lastPageButton);
    }

    return buttons;
  };

  return (
    <div className="w-full border rounded-3xl p-2">
      <table className="w-full">
        <thead>
          <tr className="border-b">
            <th className="px-6 py-4">Move Name</th>
            <th className="px-6 py-4">Level Learned At</th>
            <th className="px-6 py-4">Learn Method</th>
          </tr>
        </thead>
        <tbody className="text-center">
          {currentMoves.map((move, index) => (
            <tr className="border-b " key={index}>
              <td className=" px-6 py-4">
                <span className="">{formatText(move.move.name)}</span>
              </td>
              <td className=" px-6 py-4">
                {move.version_group_details[0]?.level_learned_at || "N/A"}
              </td>
              <td className=" px-6 py-4">
                {move.version_group_details[0].move_learn_method.name ===
                "machine"
                  ? "TM"
                  : formatText(
                      move.version_group_details[0]?.move_learn_method.name ||
                        "N/A"
                    )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div className="flex justify-end my-4">{renderPagination()}</div>
    </div>
  );
};

export default PokemonMovesTable;
